import React from "react";
import {
  Container,
  Wrapper,
  Text,
  Btn,
  SelectContainer,
} from "./NewAElements.js";
import Select from "react-select";

const options = [
  { value: "company", label: "Company" },
  { value: "smartphones", label: "Smartphones" },
  { value: "laptops", label: "Laptops" },
];

const NewA = () => {
  return (
    <>
      <Container>
        <Wrapper>
          <Text>What are you looking for ?</Text>
          <SelectContainer>
            <Select
              options={options}
              //placeholder="Select an option to procede"
            />
          </SelectContainer>
          <Btn>Submit</Btn>
        </Wrapper>
      </Container>
    </>
  );
};

export default NewA;
